  },
  OurVisionParagraph: {
    fontSize: '1rem',
    color: '#555',
  },


  OurMissionSection:{
    backgroundColor:'#eee',
    padding:'50px 0',
    display:'flex',
    alignments:'center',
  },
  OurMissionContent:{
    flex:'1',
    paddingRight:'50px'
  },
  OurMissionParagraph:{
    fontsize:'1rem',
    color:'#555',
  },
  OurMissionImageContainer:{
    flex:'1',
  },
  OurMissionImage:{
    maxWidth:'100%',
    maxHeight:'100%',
    borderRadius:'8px',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '30px',
    bottom: 0,
    width: 'auto',
  },

  };

