      <div style={styles.OurVisionImageContainer}>
        <img
          src="https://via.placeholder.com/800x300"
          alt="About Us Team in Action"
          className="OurVision-image"
          style={styles.OurVisionImage}
        />
      </div>
    </section>

);
const OurMission = () => (
  <section style={styles.OurMissionSection}>
      <div style={styles.OurMissionContent}>
        <h2 style={styles.OurMissionHeader}>Our Mission</h2>
        <p style={styles.OurMissionParagraph}>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer nec odio. Praesent libero. Sed cursus ante
