          lacinia nunc.
        </p>
        {/* Add more content about your organization here */}
      </div>
      <div style={styles.OurMissionImageContainer}>
        <img
          src="https://via.placeholder.com/800x300"
          alt="About Us Team in Action"
          className="OurMission-image"
          style={styles.OurMissionImage}
        />
      </div>
    </section>
);
const OurMethodology = () => (
  <div style={styles.OurMethodologySection}>
